import './css/App.css';
import { Route, Routes } from 'react-router-dom';
import Index from './pages/index';
import Error404 from './pages/404';
import DevTeam from './pages/devteam/DevTeam';
import SillyGoose from './pages/devteam/sillygoose';
import Kindskopf from './pages/devteam/kindskopf';
import SillyGooseSW from './pages/devteam/sillygooseSW';
import FunctionsPage from './pages/functions/functionspage';
import NimmGame from './pages/functions/nimmgame';
import CLicks from './pages/functions/clicks';
import Dashboard from './pages/dashboard/dashboard';


function App() {
 return <nav id="north">
 <div className="navbar">
   <div className="logoNav">
     <motion.a
       href="index"
       whileHover={{ scale: 1.1 }}
       whileTap={{ scale: 0.9 }}
       className="logoBtn"
     >
       <img
         className="logo"
         alt=""
         src={logo}
         width="150px"
         height="150px"
       ></img>
     </motion.a>

     <motion.button
       whileHover={{ scale: 1.1 }}
       whileTap={{ scale: 0.9 }}
       className="DashboardBtn"
       onClick={dash}
     >
       Dashboard
     </motion.button>
     <motion.button
       whileHover={{ scale: 1.05 }}
       whileTap={{ scale: 0.9 }}
       className="aboutusbtn"
       onClick={mem}
     >
       About Us
     </motion.button>
   </div>
 </div>
</nav>



}

export default App;
